import React from 'react';
import './CartPage.css';
import seoImage from '../../assets/coursPictures/SEO.png'; // adjust path if needed

const CartPage = () => {
    const cartItems = [
        { name: 'Search Engine Optimization', price: 10000 },
        { name: 'course A', price: 10000 },
        { name: 'course B', price: 10000 },
        { name: 'course C', price: 10000 },
    ];

    const total = cartItems.reduce((sum, item) => sum + item.price, 0);

    return (
        <div className="cart-container">
            <h2>Your Cart:</h2>

            <div className="cart-main">
                <div className="cart-course-card">
                    <img src={seoImage} alt="Course" />
                    <h3>Search Engine Optimization</h3>
                    <div className="course-meta">
                        <span>Topics:</span>
                        <span>Price:</span>
                        <span>Schedule:</span>
                        <span>Description:</span>
                    </div>
                </div>

                <div className="cart-summary">
                    {cartItems.map((item, index) => (
                        <p key={index}>
                            {item.name} : {item.price.toLocaleString()} nok
                        </p>
                    ))}
                    <div className="total-price">
                        <span>Total price :</span>
                        <strong>{total.toLocaleString()} NOK</strong>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default CartPage;
